import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Nav from './Nav';

function App() {
  return (
    <BrowserRouter>
      <Nav />
        <div>
          <Routes>
              <Route path='/aboutme' />
          </Routes>
        </div>
    </BrowserRouter>
  );
}

export default App;
